REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15386', 'Algalon Aggro', '100.0', '0', 'Your actions are illogical. All possible results for this encounter have been calculated. The Pantheon will receive the Observer\'s message regardless of outcome.', '1', '0', '0', '32871', '14', '0');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15837', 'Algalon JustKilled1', '100.0', '0', 'Loss of life, unavoidable.', '0', '0', '0', '32871', '14', '1');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15838', 'Algalon JustKilled2', '100.0', '0', 'I do what I must.', '0', '1', '0', '32871', '14', '1');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15390', 'Algalon FirstEngaged', '100.0', '0', 'See your world through my eyes: A universe so vast as to be immeasurable - incomprehensible even to your greatest minds.', '1', '0', '0', '32871', '14', '2');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15392', 'Algalon SummonCollapsingStars', '100.0', '0', 'The stars come to my aid.', '0', '0', '0', '32871', '14', '3');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15393', 'Algalon Death1', '100.0', '0', 'I have seen worlds bathed in the Makers\' flames. Their denizens fading without so much as a whimper. Entire planetary systems born and raised in the time that it takes your mortal hearts to beat once. Yet all throughout, my own heart, devoid of emotion... of empathy. I... have... felt... NOTHING! A million, million lives wasted. Had they all held within them your tenacity? Had they all loved life as you do?', '0', '0', '0', '32871', '12', '4');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15401', 'Algalon Death2', '100.0', '0', 'Perhaps it is your imperfection that which grants you free will. That allows you to persevere against all cosmically calculated odds. You prevailed where the Titans\' own perfect creations have failed.', '1', '0', '0', '32871', '12', '6');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15402', 'Algalon Death3', '100.0', '0', 'I\'ve rearranged the reply code. Your planet will be spared. I cannot be certain of my own calculations anymore.', '1', '0', '0', '32871', '12', '7');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15403', 'Algalon Death4', '100.0', '0', 'I lack the strength to transmit the signal. You must hurry. Find a place of power close to the skies.', '1', '0', '0', '32871', '12', '8');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15404', 'Algalon Death5', '100.0', '0', 'Do not worry about my fate Bronzen. If the signal is not transmitted in time re-origination will proceed regardless. Save. Your. World.', '1', '0', '0', '32871', '12', '9');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15394', 'Algalon Berserk', '100.0', '0', 'You are... out of time.', '0', '0', '0', '32871', '14', '10');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15396', 'Algalon BigBang', '100.0', '0', 'Witness the fury of the cosmos!', '0', '0', '0', '32871', '14', '11');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15397', 'Algalon Phaseswitch', '100.0', '0', 'Behold the tools of creation!', '0', '0', '0', '32871', '14', '12');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15405', 'Algalon Summon1', '100.0', '0', 'Trans-location complete. Commencing planetary analysis of Azeroth.', '0', '0', '0', '32871', '12', '13');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15406', 'Algalon Summon2', '100.0', '0', 'Stand back, mortals. I am not here to fight you.', '0', '0', '0', '32871', '12', '14');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15407', 'Algalon Summon3', '100.0', '0', 'It is in the universe\'s best interest to re-originate this planet should my analysis find systemic corruption. Do not interfere.', '0', '0', '0', '32871', '12', '15');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15398', 'Algalon Timeout', '100.0', '0', 'Analysis complete. There is partial corruption in the planet\'s life-support systems as well as complete corruption in most of the planet\'s defense mechanisms.', '1', '0', '0', '32871', '14', '16');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15399', 'Algalon Timeout2', '100.0', '0', 'Begin uplink: Reply Code: \'Omega\'. Planetary re-origination requested..', '1', '0', '0', '32871', '14', '17');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15400', 'Algalon Timeout3', '100.0', '0', 'Farewell, mortals. Your bravery is admirable, for such flawed creatures.', '1', '0', '0', '32871', '14', '18');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('0', 'Algalon Summon Stars', '100.0', '0', 'Algalon the Observer begins to Summon Collapsing Stars!', '0', '0', '0', '32871', '41', '19');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('0', 'Algalon Cosmic Smash', '100.0', '0', 'Algalon the Observer begins to cast Cosmic Smash', '0', '0', '0', '32871', '41', '20');
REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('0', 'Algalon Big Bang', '100.0', '0', 'Algalon the Observer begins to cast Big Bang!', '0', '0', '0', '32871', '41', '21');
