REPLACE INTO creature_text (sound, comment, probability, language, text, emote, id, duration, entry, type, groupid) VALUES('15824', 'Brann AlgalonSummoned01', '100.0', '0', 'We did it, lads! We got here before Algalon\'s arrival. Maybe we can rig the systems to interfere with his analysis--', '0', '0', '0', '34064', '14', '0');
